import React, { useEffect, useState, useRef } from "react";
import Swal from "sweetalert2";
import { Header } from "../components/Header";
import { Footer } from "../components/Footer";
import { useAuth } from "../components/AuthProvider";
import { ProductoPedido } from "../components/ProductoPedido";
import { useNavigate, useParams } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faDollarSign } from "@fortawesome/free-solid-svg-icons";
import { fas } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";

import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import { width } from "@fortawesome/free-brands-svg-icons/fa42Group";

// Registrar las fuentes
pdfMake.vfs = pdfFonts.pdfMake.vfs;

export const ConfirmarCompra = () => {
  const { userEmail, isAuthenticated } = useAuth();
  const [pedido, setPedido] = useState([]);
  const [subTotal, setsubTotal] = useState(0);
  const [total, setTotal] = useState(0)
  const [tax, setTax] = useState(0)
  const [userdata, setuserdata] = useState([]);
  const [flag, setFlag] = useState(true); //Bandera para la consulta de producto individual
  const [precio, setprecio] = useState(0);

  const { id, quantity } = useParams()

  const [papuCreditos, setPapuCreditos] = useState(0) // Variable de estado para los PapuCreditos
  const [country, setCountry] = useState("")
  const [state, setState] = useState("")
  const [zip, setZip] = useState("")
  const [company, setCompany] = useState("")
  const [address, setAddress] = useState("")
  const [city, setCity] = useState("")
  const [name, setname] = useState("")
  const [lastname, setlastname] = useState("")
  const [phone, setPhone] = useState("")

  const formRef = useRef(null); // Ref for the form

  const navigate = useNavigate();

  const IconoFlecha = <FontAwesomeIcon icon={fas.faArrowLeft}/>

  useEffect(() => {
    if(!isAuthenticated){
      navigate("/")
    }
  }, [])

  useEffect(() => {
    if (id) {
      const fetchData = async () => {
        try {
          const res = await fetch("/api/index.php", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              functionName: "consultaProductoIndividual",
              id: id,
              flag: flag,
            }),
          });

          if (!res.ok) {
            throw new Error("Error en la solicitud fetch");
          }

          const data = await res.json();
          // Actualizar el estado de productos con los datos obtenidos

          setPedido(data);
          setprecio(data[0].priceWithDiscount);
        } catch (error) {
          console.error("Error: ", error);
        }
      };

      fetchData();
    }
  }, [userEmail]);

  useEffect(() => {
    if (!id) {
      const fetchData = async () => {
        try {
          const res = await fetch("/api/index.php", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              functionName: "consultaCarrito",
              email: userEmail,
            }),
          });

          if (!res.ok) {
            throw new Error("Error en la solicitud fetch");
          }

          const data = await res.json();
          // Actualizar el estado de productos con los datos obtenidos

          setPedido(data);
        } catch (error) {
          console.error("Error:", error);
        }
      };

      fetchData();
    }
  }, [userEmail]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await fetch("/api/index.php", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            functionName: "consultaUsuarioData",
            email: userEmail,
          }),
        });

        if (!res.ok) {
          throw new Error("Error en la solicitud fetch");
        }

        const data = await res.json();
        // Actualizar el estado de productos con los datos obtenidos

        setuserdata(data);
      } catch (error) {
        console.error("Error:", error);
      }
    };

    fetchData();
  }, []);

  useEffect(() => {
    const { first_name, last_name, phone, papu_credits, country, state, zip, company, address, city } =
      userdata
    setPapuCreditos(papu_credits)
    setCountry(country)
    setState(state)
    setZip(zip)
    setCompany(company)
    setAddress(address)
    setCity(city)
    setname(first_name)
    setlastname(last_name)
    setPhone(phone)
  }, [userdata]);

  const pedidoTotal = () => {
    const total = id
      ? precio * quantity
      : pedido.reduce(
          (total, item) =>
            total + (item.priceWithDiscount || 0) * item.quantity,
          0
        );
        let truncado = Math.floor(total * 100) / 100;
    return truncado;
  };

  useEffect(() => {
    setsubTotal(pedidoTotal)
    console.log(pedido)
  }, [pedido]);

  useEffect(() => {
    const temp = subTotal * 0.1
    let truncado = Math.floor(temp * 100) / 100;
    setTax(truncado)
  }, [subTotal])
  
  useEffect(() => {
    const temp = subTotal + tax
    let truncado = Math.floor(temp * 100) / 100;
    setTotal(truncado)
  }, [tax])


  const placeOrder = async (event) => {
    event.preventDefault(); // Evita que el formulario se envíe automáticamente

    const addressInput = document.getElementById("address");
    const countryInput = document.getElementById("country");
    const stateInput = document.getElementById("state");
    const cityInput = document.getElementById("city");
    const zipInput = document.getElementById("zip");

    if (
      !addressInput.value ||
      !countryInput.value ||
      !stateInput.value ||
      !cityInput.value ||
      !zipInput.value
    ) {
      Swal.fire({
        icon: "error",
        title: "Validation failed",
        text: "Please fill in all required fields",
        showConfirmButton: false,
        timer: 2500,
      });
      return;
    }
    if (papuCreditos > subTotal) {
      try {
        if (id) {
          const res = await fetch("/api/index.php", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              functionName: "agregarCompraIndividual",
              email: userEmail,
              total: total,
              pedido: pedido,
              quantity: quantity,
              country: country,
              state: state,
              zip: zip,
              address: address,
              city: city,
            }),
          });

          const result = await res.json();

          if (result.success) {
            Swal.fire({
              icon: "success",
              title: "The order was placed successfully",
              text: "Enjoy your products!",
              showConfirmButton: false,
              timer: 2500,
            });
          } else {
            Swal.fire({
              icon: "error",
              title: "There was an error placing the order",
              text: "Try again",
              showConfirmButton: false,
              timer: 2500,
            });
          }
        } else {
          const res = await fetch("/api/index.php", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              functionName: "agregarCompra",
              email: userEmail,
              total: total,
              pedido: pedido,
              country: country,
              state: state,
              zip: zip,
              address: address,
              city: city,
            }),
          });

          const result = await res.json();

          if (result.success) {
            Swal.fire({
              icon: "success",
              title: "The order was placed successfully",
              text: "Enjoy your products!",
              showConfirmButton: false,
              timer: 2500,
            });
          } else {
            Swal.fire({
              icon: "error",
              title: "There was an error placing the order",
              text: "Try again",
              showConfirmButton: false,
              timer: 2500,
            });
          }
        }
      } catch (error) {
        console.error("Error:", error);
      }
    } else {
      Swal.fire({
        icon: "error",
        title: "You don't have enough papuCredits",
        text: "Choose other products",
        showConfirmButton: false,
        timer: 2500,
      });
    }

    const timer = setTimeout(() => {
      generatePDF();
      navigate("/tienda");
    }, 3000);
  };

  //Función para generar PDFs
  const generatePDF = () => {
    const docDefinition = {
      content: [
        { image: "data:image/png;base64,", width: 100, style: "image"},
        { text: "Shipping Information", style: "bigtext" },
        { text: [`Country: ${country}`], style: "text" },
        { text: [`State: ${state}`], style: "text" },
        { text: [`City: ${city}`], style: "text" },
        { text: [`Address: ${address}`], style: "text" },
        { text: [`Zip: ${zip}`], style: "text" },
        { text: "Customer Information", style: "bigtext" },
        { text: [`Name: ${name} ${lastname}`], style: "text" },
        { text: [`Phone Number: ${phone}`], style: "text" },
        { text: "Products", style: "header", margin:[0,4] },
        {
          style: "tableStyle",
          table: {
            headerRows: 1,
            widths: ["*", "auto", "auto"],
            body: [
              [
                { text: "Product", style: "tableHeader" },
                { text: "Quantity", style: "tableHeader" },
                { text: "Price", style: "tableHeader" },
              ],
              ...pedido.map((item) => [item.title, item.quantity ? item.quantity : quantity, `$ ${item.priceWithDiscount} USD`]),
            ],
          },
          layout: {
            hLineWidth: (i) => (i <= 1 ? 1 : 0), // Líneas horizontales en el encabezado
            vLineWidth: () => 0, // No hay líneas verticales
            hLineColor: () => "black", // Color de las líneas horizontales
            paddingLeft: () => 5,
            paddingRight: () => 5,
            paddingTop: () => 5,
            paddingBottom: () => 5,
          },
        },
        { text: [`Subtotal: $ ${subTotal} USD`], style: "text" },
        { text: [`Tax: $ ${tax} USD`], style: "text" },
        { text: [`Total: $ ${total} USD`], style: "bigtext", margin:[0,4] },
        { text: [`Thank you for shopping with us!`], style: "bigtext", margin:[0,8] },
      ],
      styles: {
        header: {
          fontSize: 16,
          bold: true,
        },
        text: {
          fontSize: 10,
        },
        bigtext: {
          fontSize: 14,
          bold: true,
        },
        tableStyle: {
          margin: [0, 5, 0, 15],
        },
        image: {
          margin: [0, 0, 0, 10]
        },
      },
    };

    pdfMake.createPdf(docDefinition).open();
  };

  const handleOrder = () => {
    placeOrder();
  };

  return (
    <>
      <Header />
      <div className="bg-gray-100 p-8 flex flex-col lg:flex-row mt-11">
        {/* Billing Information */}
        <form ref={formRef} onSubmit={placeOrder} className="bg-white p-8 rounded-lg shadow-md w-full lg:w-2/3 mb-8 lg:mb-0 lg:mr-8">
        <Link to="/carrito">
                <button className="flex font-semibold text-sm text-black items-center sm:justify-start w-full sm:w-auto mb-4">
                  <span>{IconoFlecha} BACK TO CART</span>
                </button>
              </Link>
          <h2 className="text-2xl font-bold mb-6">BILLING INFORMATION</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-4">
            <div className="md:col-span-2">
              <label className="block text-gray-700">
                ADDRESS 
              </label>
              <input
                type="text"
                id="address"
                value={address}
                onChange={(e) => setAddress(e.target.value)}
                className="mt-1 block w-full rounded-md border-2 border-gray-300 p-2 shadow-sm focus:border-indigo-500 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
                placeholder="Company Name"
              />
            </div>
            <div>
              <label className="block text-gray-700">COUNTRY</label>
              <input
                type="text"
                id="country"
                value={country}
                onChange={(e) => setCountry(e.target.value)}
                className="mt-1 block w-full rounded-md border-2 border-gray-300 p-2 shadow-sm focus:border-indigo-500 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
                placeholder="Country"
              />
            </div>
            <div>
              <label className="block text-gray-700">STATE</label>
              <input
                type="text"
                id="state"
                value={state}
                onChange={(e) => setState(e.target.value)}
                className="mt-1 block w-full rounded-md border-2 border-gray-300 p-2 shadow-sm focus:border-indigo-500 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
                placeholder="State"
              />
            </div>
            <div>
              <label className="block text-gray-700">CITY</label>
              <input
                type="text"
                id="city"
                value={city}
                onChange={(e) => setCity(e.target.value)}
                className="mt-1 block w-full rounded-md border-2 border-gray-300 p-2 shadow-sm focus:border-indigo-500 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
                placeholder="City"
              />
            </div>
            <div>
              <label className="block text-gray-700">ZIP CODE</label>
              <input
                type="text"
                id="zip"
                value={zip}
                onChange={(e) => setZip(e.target.value)}
                className="mt-1 block w-full rounded-md border-2 border-gray-300 p-2 shadow-sm focus:border-indigo-500 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
                placeholder="Zip Code"
              />
            </div>
          </div>
          <div className="mt-6">
            <h2 className="text-xl font-bold mb-2">PAPUCREDITS</h2>
            <div className="flex items-center text-lg text-gray-700">
              <FontAwesomeIcon
                icon={faDollarSign}
                className="mr-2 text-green-500"
              />
              <span className="font-bold">{papuCreditos}</span>
              <span className="ml-2 text-sm">USD</span>
            </div>
          </div>
          <button
          onClick={handleOrder}
            className="mt-6 w-full bg-orange-500 hover:bg-orange-600 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            PLACE ORDER
          </button>
        </form>
        {/* Order Summary */}
        <div className="bg-white p-8 rounded-lg shadow-md w-full lg:w-1/3">
          <h2 className="text-2xl font-bold mb-6">ORDER SUMMARY</h2>
          <div className="mb-4">
            {pedido.map((item) => (
              <ProductoPedido
                key={item.id}
                item={item}
                quantityBuynow={quantity}
              />
            ))}
          </div>
          <div className="border-t pt-4">
            <div className="flex justify-between mb-2">
              <div>SUBTOTAL</div>
              <div>$ {subTotal} USD</div>
            </div>
            <div className="flex justify-between mb-2">
              <div>SHIPPING</div>
              <div>Free</div>
            </div>
            <div className="flex justify-between mb-2">
              <div>TAX</div>
              <div>$ {tax} USD</div>
            </div>
            <div className="flex justify-between font-bold text-lg">
              <div>TOTAL</div>
              <div>$ {total} USD</div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};
